export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},"53MpqkGDst":{data:{id:165,attributes:{imdbId:"tt0085169",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTQwOTgwMTgtOTVhMy00ZTJkLTlkNmItMWM4NGI0OGEwMDM2XkEyXkFqcGdeQXVyNzMzMjU5NDY@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.1\u002F10"}],item_lang:{data:{id:828,attributes:{title:g,plot:"Anna Hart was always an odd child, a genius, a shoplifter, desperately afraid of flickering lights, with strange prophetic dreams. Simultaneously, several strange things begin to happen. A strange, mysterious neighbor, by the name of MacKayla moves in next door to the Harts. And, most frightening of all, Anna sees her exact double on the television one night. As her investigation of the other Anna, Anna Smithson, progresses, she begins to learn the truth. The truth about a woman named Anna Zimmerman that has been dead for twenty years, and most importantly, the truth about herself.",slug:"anna-to-the-infinite-power"}}},books:{data:[{id:2426,attributes:{title:g,description:"A 12-year-old math whiz accidentally learns the startling facts about her true identity and her role in an important secret experiment.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=itoPMfJEuHAC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"1983-06-01",publisher:"Scholastic",subtitle:c}},{id:2427,attributes:{title:"Language Arts",description:"Provides a clear and succinct introduction to teaching the language arts to elementary students Key Features Focuses on integrating the six language arts—reading, writing, listening, speaking, viewing, and visually representing—with other subject areas Provides guidance on differentiating instruction to bring out the best in the rapidly growing number of students with special needs and English language learners in the regular classroom Includes a detailed lesson plan in each chapter along with instructional activities and techniques to integrate the language arts across all the subjects in the elementary curriculum Accompanied by High-Quality Ancillaries! Student Resource CD: Bundled with the book, this CD includes video clips and discussion questions that correlate with important chapter concepts. Web-based student study site This interactive study site provides practice tests, flashcards, chapter summaries, links to NCTE\u002FIRA and state-specific Language Arts standards, and much more. Instructor Resources on CD: Available by contacting SAGE Customer Care at 1-800-818-SAGE (7243), this CD for instructors offers resources such as lecture outlines, PowerPoint slides, a test bank, and sample syllabi for semester and quarter courses. Intended Audience This book is intended for undergraduate and graduate courses in elementary language arts methods, which teaches pre-service teachers and licensure\u002Fcertification candidates specifically how to teach their students the basics of the six language arts – reading, writing, listening, speaking, viewing, and visually representing.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Lg5mDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Mildred R. Donoghue"],firstBook:d,published:"2008-08-05",publisher:"SAGE Publications",subtitle:"Integrating Skills for Classroom Teaching"}},{id:2428,attributes:{title:"Cassandra-Jamie",description:"Once she decides to arrange her father's marriage to the English teacher she adores, Jamie begins to discover people are not always as they seem to be on the surface.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=BGk4pKvENxQC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1985-01-01",publisher:h,subtitle:c}},{id:2429,attributes:{title:"The Silver Link, the Silken Tie",description:"Teenagers Felice and Tim, both with tragedy in their backgrounds, suffer from psychological problems, and, with the help of psychiatry and each other, become more independent, caring persons.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=X3YtP2S40noC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1986-04-01",publisher:"Scholastic Paperbacks",subtitle:c}},{id:2430,attributes:{title:"Philo Potts, Or, The Helping Hand Strikes Again",description:"Eleven-year-old Philo and his friend Cristabel kidnap a neighbor's neglected dog, hoping to make his owner appreciate him, but plans go awry when the dog makes friends with a pack of unruly strays.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=bcFaAAAAYAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1982-01-01",publisher:h,subtitle:c}}]}}},meta:{}}},prerenderedAt:1681309135673}}("movie","Mildred Ames","",null,"series",1,"Anna to the Infinite Power","Atheneum"))